import React from 'react';
import '../../App.css';
import './Contact.css';

function Contact() {
  return (
    <>
      <div className="info-text">
      The US wastes 35 million tons of food every year while 1 every 6 Americans is food-insecure. If you are interested in learning more about Brownâ€™s Chapter of FRN or have ideas on how we can further reduce food waste and help homeless shelters stay functional, shoot us an email!
      </div>
      <div className='separator'></div>
      <div className='highlight' style={{ fontSize: '36px', marginBottom: '20px', marginTop: '70px', marginLeft: '156px' }}>
        Send Us an Email
      </div>
      <div className='contact-list'>
      <ul>
          <li>General: </li><li><a href="mailto:foodrecoverynetwork@brown.edu">foodrecoverynetwork@brown.edu</a></li>
          <li>Ayla Kim: <a href="mailto:ayla_kim@brown.edu">ayla_kim@brown.edu</a></li>
          <li>Emma Weech: <a href="mailto:emma_weech@brown.edu">emma_weech@brown.edu</a></li>
          <li>Seth Peiris: <a href="mailto:seth_peiris@brown.edu">seth_peiris@brown.edu</a></li>
          <li>Alex Zeng: <a href="mailto:alexander_zeng@brown.edu">alexander_zeng@brown.edu</a></li>
          <li>David Veloso: <a href="mailto:david_veloso@brown.edu">david_veloso@brown.edu</a></li>
          <li>Athena Deng: <a href="mailto:athena_deng@brown.edu">athena_deng@brown.edu</a></li>
          <li>Ran Zhao: <a href="mailto:ran_zhao@brown.edu">ran_zhao@brown.edu</a></li>
          <li>Bailey Smoko: <a href="mailto:bailey_smoko@brown.edu">bailey_smoko@brown.edu</a></li>
          {/* Add more people and their emails as needed */}
        </ul>
      </div>
    </>
  );
}

export default Contact;
